import ProjectCard from "./ProjectCard";
import ArrowButton from "../ArrowButton";

function Projects() {
    return (
      <>
        <p className="text-center">Browse My Recent</p>
        <h1 className="text-[3rem] text-center font-bold">Projects</h1>
        <div className="flex justify-center flex-col">
          <div className="gap-[2rem] my-[2rem]">
            <ProjectCard title="Project 1" image="/images/project-1.png"/>
            <ProjectCard title="Project 2" image="/images/project-2.png"/>
            <ProjectCard title="Project 3" image="/images/project-3.png"/>
          </div>
        </div>
        <ArrowButton href="#contact"/>
      </>
    );
}

export default Projects;
